INSERT INTO `mdl_course_sections` VALUES (13,4,0,NULL,'',1,'7',1,NULL,0),(14,4,1,'','<h3>Como tudo comeou</h3><p>O Moodle  um projeto que comeou a ser desenvolvido por Martim Dougiamas, que ainda faz parte do projeto. Nos anos de 1990, ainda como webmaster na Curtin University of Technology e administrador de sistemas de instalao deles, comeou a sentir uma grande frustrao com os cursos oferecidos pela internet. Como, na poca, ainda tudo o que era disponvel nessa rea era pago, Dougiamas queria que as pessoas tivessem uma alternativa que fosse gratuita para que pudessem disponibilizar o seu contedo, as suas capacidades e poderem trocar informaes de forma sensata e que agregasse valor a quem participasse da aula.</p>',1,'9',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1571961274),(15,4,2,'','<h3>O desenvolvimento da plataforma e as ideias</h3><p>Toda essa insatisfao fez com que Dougiamas se especializasse na rea de educao, fazendo mestrado e doutorado na rea, sempre  claro combinando a sua carreira na rea de cincia da computao com o que tinha acabado de elaborar, o conceito de conhecimento sobre a natureza da aprendizagem e da colaborao.</p>',1,'',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1571961292),(16,4,3,'','<h3>A ideia inicial da Plataforma Moodle</h3><p>A sua grande influncia veio da epistemologia do construcionismo social, que tem como principal base a aprendizagem como uma atividade social, sempre com foco na aprendizagem que ocorre enquanto h a construo ativa de artefatos, como textos, perguntas etc.</p>',1,'',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1571961306),(17,4,4,'','<h3>Aspectos funcionais da plataformas</h3><p>Para Dougiamas, era essencial que a plataforma fosse fcil de usar, de forma bem intuitiva para que at aqueles que no esto acostumados a usar o computador pudessem ter acesso. Na plataforma,  possvel participar de chats com os alunos e professores, disponibilizar arquivos de material do curso para downloads e at mesmo fazer exerccios.</p>',1,'',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1571961331),(18,4,5,'','<h3>Desenvolvimento da Plataforma Moodle</h3><p>Nada que  desenvolvido fica pronto de uma hora para outra. Sempre  necessrio muita pesquisa e adaptaes. Com o Moodle no foi diferente, uma vez que foram desenvolvidos vrios prottipos at que se chegasse  plataforma final. Isso, porm, no quer dizer que a plataforma no passa mais por mudanas, uma vez que sempre h algo o que aperfeioar, para oferecer um melhor servio a cada dia. Os primeiros prottipos foram desenvolvidos, mas acabaram sendo deixados de lado. Porm, em 20 de agosto de 2002, Dougiamas lanou a verso 1.0 da Plataforma Moodle, o que deixou muitas pessoas surpresas.</p>',1,'',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1571961351),(19,4,6,'','<p><h3>A verso 1.0 e suas outras verses</h3><p>Essa primeira verso lanada era voltada para pequenas turmas, com nvel universitrio, que sempre eram sujeitas a pesquisas de estudo de casos. Pois, dessa forma, era possvel analisar a natureza de colaborao e da reflexo que aconteciam. A partir desses estudos de casos foram desenvolvidas muitas outras verses, sempre acrescentando novos recursos, com uma melhor escalabilidade, mostrando o seu melhor desempenho.</p><br></p>',1,'',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1571961374),(20,4,7,'','<p><h3>Plataforma Moodle hoje</h3><p>A plataforma cresceu muito, espalhando-se por todo mundo e para diferentes nveis de aprendizado, j que atualmente existem cursos abertos no Moodle, escolas de ensino mdio e fundamental que utilizam a plataforma. No deixe de comentar abaixo sobre como  sua relao com Moodle. At a prxima!</p><br></p>',1,'10',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1571961388),(21,4,8,NULL,'',1,'8',1,NULL,1571961358),(22,4,9,'','<p>Tutorial Moodle Completo passo-a-passo</p><p>&nbsp;<a href=\"https://www.youtube.com/playlist?list=PLd-QtXnha0KcZoD8CqIbLg3I11Vptvfnk\">https://www.youtube.com/playlist?list=PLd-QtXnha0KcZoD8CqIbLg3I11Vptvfnk</a><br></p>',1,'',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1571961567),(23,4,10,'','<p>Outra play list de Moodle</p><p><a href=\"https://www.youtube.com/playlist?list=PLd-QtXnha0KdkQQn9JMtS_LGEq413fTwE\">https://www.youtube.com/playlist?list=PLd-QtXnha0KdkQQn9JMtS_LGEq413fTwE</a><br></p>',1,'',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1571961601),(27,1,1,NULL,'',1,'',1,NULL,1571963097);
