\\u00edvel em diversos idiomas.\\n\\nA plataforma v\\u00eam sendo utilizada n\\u00e3o s\\u00f3 como ambiente de suporte \\u00e0\\nEduca\\u00e7\\u00e3o a Dist\\u00e2ncia mas tamb\\u00e9m como apoio a cursos presenciais,\\nforma\\u00e7\\u00e3o de grupos de estudo, treinamento de professores.\\n\\nO moodle v\\u00eam sendo usado para apoio de cursos presencias, os professores\\nacabam substituindo em deixar material na copiadora da faculdade ou enviar\\narquivos para uma grande quantidade de emails de seus alunos, ele apenas\\ntem que ter uma disciplina criada no moodle para \\u201cpendurar\\u201d l\\u00e1 os\\narquivos de texto, que os alunos devem ler para o acompanhamento da\\nmat\\u00e9ria. \\u00c9 uma solu\\u00e7\\u00e3o f\\u00e1cil, que n\\u00e3o exige muito conhecimento\\nt\\u00e9cnico do professor e nem mesmo do aluno.\\n\\nSe o professor desejar, o moodle tamb\\u00e9m envia um email para os alunos\\navisando que existe material novo no curso. Evita que o professor tenha que\\ndigitar muitos emails, desta forma ningu\\u00e9m fica com a caixa cheia de\\nemails e arquivos, o aluno entra no curso para baixar ou ler o conte\\u00fado,\\nassim fica mais f\\u00e1cil administrar seu tempo para estudar.\\n\\nAqui um\\u00a0tutorial Moodle\\u00a0 [1]bem legal do Mackenzie que explica em\\ndetalhes como o professor deve fazer para configurar essa tarefa no Moodle.\\n\\nAproveite para assinar nosso\\u00a0Canal no Youtube [2]\\u00a0e se precisar de ajuda\\nfale comigo aqui pelos coment\\u00e1rios ou atrav\\u00e9s do\\u00a0f\\u00f3rum do blog [3].\\u00a0\\n\\nSAIBA MAIS SOBRE O MOODLE, desde customiza\\u00e7\\u00e3o, inscri\\u00e7\\u00e3o de alunos,\\ncria\\u00e7\\u00e3o de cursos \\u00e0 gamifica\\u00e7\\u00e3o!\\u00a0\\nCurso Moodle para Professores e Administradores:\\u00a0www.salaead.com.br [4]\\n\\n\\n\\nLinks:\\n------\\n[1] http:\\/\\/moodlelivre.files.wordpress.com\\/2008\\/09\\/como_publicar_material.pdf\\n[2] https:\\/\\/www.youtube.com\\/channel\\/UCbK2ONLCFLO_9_ha_nnJcog\\n[3] https:\\/\\/www.moodlelivre.com.br\\/kunena\\/indice\\n[4] http:\\/\\/www.salaead.com.br\\/\\n\\n\\n\\n---------------------------------------------------------------------\\nChange your forum digest preferences: http:\\/\\/127.0.0.1:80\\/mod\\/forum\\/index.php?id=2\",\"errorinfo\":\"Invalid address:  (punyEncode) noreply@127.0.0.1\"}',1571959382,'cli',NULL,NULL),(188,'\\core\\event\\notification_sent','core','sent','notification','notifications',2,'c',0,1,10,0,2,0,3,0,'{\"courseid\":\"2\"}',1571959382,'cli',NULL,NULL),(189,'\\core\\event\\email_failed','core','failed','email',NULL,NULL,'c',0,1,10,0,2,0,2,0,'{\"subject\":\"MoodleBasico: O que \\u00e9 o Moodle\",\"message\":\"MoodleBasico -> F\\u00f3runs -> Announcements -> O que \\u00e9 o Moodle \\nhttp:\\/\\/127.0.0.1:80\\/mod\\/forum\\/discuss.php?d=1#p1\\nO que \\u00e9 o Moodle\\npor Admin User - Thursday, 24 Oct 2019, 19:52\\n---------------------------------------------------------------------\\nO moodle \\u00e9 um software livre de apoio \\u00e0 aprendizagem, pode ser instalado\\nem v\\u00e1rias plataformas que consigam executar a linguagem php tais como\\nUnix, Linux, Windows. MAC OS. Como base de dados podem ser utilizados\\nMySQL, PostgreSQL, Oracle, Access, Interbase ou ODBC.\\n\\nSeu desenvolvimento \\u00e9 de forma colaborativa por uma comunidade virtual, a\\nqual re\\u00fane programadores, designers, administradores, professores e\\nusu\\u00e1rios do mundo inteiro e est\\u00e1 dispon\\u00edvel em diversos idiomas.\\n\\nA plataforma v\\u00eam sendo utilizada n\\u00e3o s\\u00f3 como ambiente de suporte \\u00e0\\nEduca\\u00e7\\u00e3o a Dist\\u00e2ncia mas tamb\\u00e9m como apoio a cursos presenciais,\\nforma\\u00e7\\u00e3o de grupos de estudo, treinamento de professores.\\n\\nO moodle v\\u00eam sendo usado para apoio de cursos presencias, os professores\\nacabam substituindo em deixar material na copiadora da faculdade ou enviar\\narquivos para uma grande quantidade de emails de seus alunos, 