INSERT INTO `mdl_notifications` VALUES (1,-10,3,'Voc enviou sua tarefa para Tarefa de casa','MoodleBasico -> Tarefa -> Tarefa de casa\n---------------------------------------------------------------------\nVoc enviou uma tarefa para \'Tarefa de casa\'\n\nVoc pode ver o estado do seu envio:\n\n  https://localhost/mod/assign/view.php?id=4\n\n---------------------------------------------------------------------\n',2,'<p><font face=\"sans-serif\"><a href=\"https://localhost/course/view.php?id=2\">MoodleBasico</a> -><a href=\"https://localhost/mod/assign/index.php?id=2\">Tarefa</a> -><a href=\"https://localhost/mod/assign/view.php?id=4\">Tarefa de casa</a></font></p><hr /><font face=\"sans-serif\"><p><p>Voc enviou uma tarefa em <i>Tarefa de casa</i>\'.</p>\n<p>Voc pode ver aqui o status da sua <a href=\"https://localhost/mod/assign/view.php?id=4\">tarefa enviada</a>.</p></p></font><hr />','Voc enviou sua tarefa para Tarefa de casa','mod_assign','assign_notification','https://localhost/mod/assign/view.php?id=4','Tarefa de casa',NULL,1571958678,'{\"cmid\":\"4\",\"instance\":\"1\",\"messagetype\":\"submissionreceipt\",\"blindmarking\":false,\"uniqueidforuser\":\"1\",\"courseid\":\"2\"}'),(2,2,3,'MoodleBasico: O que  o Moodle','MoodleBasico -> Forums -> Announcements -> O que  o Moodle \nhttp://127.0.0.1:80/mod/forum/discuss.php?d=1#p1\nO que  o Moodle\nby Admin User - Thursday, 24 October 2019, 7:52 PM\n---------------------------------------------------------------------\nO moodle  um software livre de apoio  aprendizagem, pode ser instalado\nem vrias plataformas que consigam executar a linguagem php tais como\nUnix, Linux, Windows. MAC OS. Como base de dados podem ser utilizados\nMySQL, PostgreSQL, Oracle, Access, Interbase ou ODBC.\n\nSeu desenvolvimento  de forma colaborativa por uma comunidade virtual, a\nqual rene programadores, designers, administradores, professores e\nusurios do mundo inteiro e est disponvel em diversos idiomas.\n\nA plataforma vm sendo utilizada no s como ambiente de suporte \nEducao a Distncia mas tambm como apoio a cursos presenciais,\nformao de grupos de estudo, treinamento de professores.\n\nO moodle vm sendo usado para apoio de cursos presencias, os professores\nacabam substituindo em deixar material na copiadora da faculdade ou enviar\narquivos para uma grande quantidade de emails de seus alunos, ele apenas\ntem que ter uma disciplina criada no moodle para pendurar l os\narquivos de texto, que os alunos devem ler para o acompanhamento da\nmatria.  uma soluo fcil, que no exige muito conhecimento\ntcnico do professor e nem mesmo do aluno.\n\nSe o professor desejar, o moodle tambm envia um email para os alunos\navisando que existe material novo no curso. Evita que o professor tenha que\ndigitar muitos emails, desta forma ningum fica com a caixa cheia de\nemails e arquivos, o aluno entra no curso para baixar ou ler o contedo,\nassim fica mais fcil administrar seu tempo para estudar.\n\nAqui umtutorial Moodle [1]bem legal do Mackenzie que explica em\ndetalhes como o professor deve fazer para configurar essa tarefa no Moodle.\n\nAproveite para assinar nossoCanal no Youtube [2]e se precisar de ajuda\nfale comigo aqui pelos comentrios ou atravs dofrum do blog [3].\n\nSAIBA MAIS SOBRE O MOODLE, desde customizao, inscrio de alunos,\ncriao de cursos  gamificao!\nCurso Moodle para Professores e Administradores:www.salaead.com.br [4]\n\n\n\nLinks:\n------\n[1] http://moodlelivre.files.wordpress.com/2008/09/como_publicar_material.pdf\n[2] https://www.youtube.com/channel/UCbK2ONLCFLO_9_ha_nnJcog\n[3] https://www.moodlelivre.com.br/kunena/indice\n[4] http://www.salaead.com.br/\n\n\n\n---------------------------------------------------------------------\nChange your forum digest preferences: http://127.0.0.1:80/mod/forum/index.php?id=2',2,'<div class=\"navbar\">\n    <a target=\"_blank\" href=\"http://127.0.0.1:80/course/view.php?id=2\">MoodleBasico</a>\n    &raquo;\n    <a target=\"_blank\" href=\"http://127.0.0.1:80/mod/forum/index.php?id=2\">Forums</a>\n    &raquo;\n    <a target=\"_blank\" href=\"http://127.0.0.1:80/mod/forum/view.php?f=1\">Announcements</a>\n    &raquo;\n    <a target=\"_blank\" href=\"http://127.0.0.1:80/mod/forum/discuss.php?d=1\">O que  o Moodle</a>\n</div>\n\n<table border=\"0\" cellpadding=\"3\" cellspacing=\"0\" class=\"forumpost\">\n    <tr class=\"header\">\n        <td width=\"35\" valign=\"top\" class=\"picture left\">\n            <a href=\"http://127.0.0.1:80/user/view.php?id=2&amp;course=2\"><img src=\"http://127.0.0.1:80/theme/image.php/_s/boost/core/1571957904/u/f2\" class=\"userpicture defaultuserpic\" width=\"35\" height=\"35\" alt=\"Picture of Admin User\" title=\"Picture of Admin User\" /></a>\n        </td>\n        <td class=\"topic starter\">\n            <div class=\"subject\">\n                O que  o Moodle\n            </div>\n            <div class=\"author\">\n                by <a target=\'_blank\' href=\'http://127.0.0.1:80/user/view.php?id=2&course=2\'>Admin User</a> - Thursday, 24 October 2019, 7:52 PM\n            </div>\n        </td>\n    </tr>\n    <tr>\n        <td class=\"left side\" valign=\"top\">\n                &nbsp;\n        </td>\n        <td class=\"content\">\n            <p></p><p>O moodle  um software livre de apoio  aprendizagem, pode ser instalado em vrias plataformas que consigam executar a linguagem php tais como Unix, Linux, Windows. MAC OS. Como base de dados podem ser utilizados MySQL, PostgreSQL, Oracle, Access, Interbase ou ODBC.</p><p>Seu desenvolvimento  de forma colaborativa por uma comunidade virtual, a qual rene programadores, designers, administradores, professores e usurios do mundo inteiro e est disponvel em diversos idiomas.</p><p>A plataforma vm sendo utilizada no s como ambiente de suporte  Educao a Distncia mas tambm como apoio a cursos presenciais, formao de grupos de estudo, treinamento de professores.</p><p>O moodle vm sendo usado para apoio de cursos presencias, os professores acabam substituindo em deixar material na copiadora da faculdade ou enviar arquivos para uma grande quantidade de emails de seus alunos, ele apenas tem que ter uma disciplina criada no moodle para pendurar l os arquivos de texto, que os alunos devem ler para o acompanhamento da matria.  uma soluo fcil, que no exige muito conhecimento tcnico do professor e nem mesmo do aluno.</p><p>Se o professor desejar, o moodle tambm envia um email para os alunos avisando que existe material novo no curso. Evita que o professor tenha que digitar muitos emails, desta forma ningum fica com a caixa cheia de emails e arquivos, o aluno entra no curso para baixar ou ler o contedo, assim fica mais fcil administrar seu tempo para estudar.</p><p>Aqui um<a href=\"http://moodlelivre.files.wordpress.com/2008/09/como_publicar_material.pdf\">tutorial Moodle</a>bem legal do Mackenzie que explica em detalhes como o professor deve fazer para configurar essa tarefa no Moodle.</p><p>Aproveite para assinar nosso<a href=\"https://www.youtube.com/channel/UCbK2ONLCFLO_9_ha_nnJcog\" target=\"_blank\" rel=\"noreferrer noopener\">Canal no Youtube</a>e se precisar de ajuda fale comigo aqui pelos comentrios ou atravs do<a href=\"https://www.moodlelivre.com.br/kunena/indice\" target=\"_blank\" rel=\"noreferrer noopener\">frum do blog</a>.</p><p><strong>Saiba mais sobre o Moodle</strong>, desde customizao, inscrio de alunos, criao de cursos  gamificao!<br />Curso Moodle para Professores e Administradores:<a href=\"http://www.salaead.com.br/\" target=\"_blank\" rel=\"noreferrer noopener\">www.salaead.com.br</a></p><br />\n\n            <div class=\"commands\">\n            </div>\n\n            <div class=\"link\">\n                <a target=\"_blank\" href=\"http://127.0.0.1:80/mod/forum/discuss.php?d=1#p1\">\n                    See this post in context\n                </a>\n            </div>\n        </td>\n    </tr>\n</table>\n\n<hr />\n<div class=\"mdl-align unsubscribelink\">\n    <a href=\"http://127.0.0.1:80/mod/forum/index.php?id=2\">Change your forum digest preferences</a>\n</div>','Admin User posted in MoodleBasico: Announcements: O que  o Moodle','mod_forum','posts','http://127.0.0.1:80/mod/forum/discuss.php?d=1#p1','O que  o Moodle',NULL,1571959382,'{\"cmid\":\"1\",\"instance\":\"1\",\"discussionid\":\"1\",\"postid\":\"1\",\"notificationiconurl\":\"http:\\/\\/127.0.0.1:80\\/theme\\/image.php\\/_s\\/boost\\/core\\/1571957904\\/u\\/f2\",\"actionbuttons\":{\"reply\":\"Reply\"},\"courseid\":\"2\"}'),(3,2,2,'MoodleBasico: O que  o Moodle','MoodleBasico -> Fruns -> Announcements -> O que  o Moodle \nhttp://127.0.0.1:80/mod/forum/discuss.php?d=1#p1\nO que  o Moodle\npor Admin User - Thursday, 24 Oct 2019, 19:52\n---------------------------------------------------------------------\nO moodle  um software livre de apoio  aprendizagem, pode ser instalado\nem vrias plataformas que consigam executar a linguagem php tais como\nUnix, Linux, Windows. MAC OS. Como base de dados podem ser utilizados\nMySQL, PostgreSQL, Oracle, Access, Interbase ou ODBC.\n\nSeu desenvolvimento  de forma colaborativa por uma comunidade virtual, a\nqual rene programadores, designers, administradores, professores e\nusurios do mundo inteiro e est disponvel em diversos idiomas.\n\nA plataforma vm sendo utilizada no s como ambiente de suporte \nEducao a Distncia mas tambm como apoio a cursos presenciais,\nformao de grupos de estudo, treinamento de professores.\n\nO moodle vm sendo usado para apoio de cursos presencias, os professores\nacabam substituindo em deixar material na copiadora da faculdade ou enviar\narquivos para uma grande quantidade de emails de seus alunos, ele apenas\ntem que ter uma disciplina criada no moodle para pendurar l os\narquivos de texto, que os alunos devem ler para o acompanhamento da\nmatria.  uma soluo fcil, que no exige muito conhecimento\ntcnico do professor e nem mesmo do aluno.\n\nSe o professor desejar, o moodle tambm envia um email para os alunos\navisando que existe 